// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

/// @title Registry of Escrow Agents and Fee Policies
contract EscrowRegistry {
    mapping(address => uint256) public agentFeeRate; // fee rate in basis points per agent

    function setFeeRate(address agent, uint256 feeRate) external {
        require(feeRate <= 10000, "Fee rate too high");
        agentFeeRate[agent] = feeRate;
    }

    function getFeeRate(address agent) external view returns (uint256) {
        return agentFeeRate[agent];
    }
}

/// @title Factory that creates escrow contracts
contract EscrowFactory {
    address public registry;
    address[] public allEscrows;

    event EscrowCreated(address indexed escrow, address indexed buyer, address indexed seller);

    constructor(address _registry) {
        registry = _registry;
    }

    function createEscrow(
        address _buyer,
        address _seller,
        uint256 _purchaseAmount,
        bytes32 _agreementHash
    ) external returns (address) {
        address newEscrow = address(new RealEstateEscrow(
            _buyer,
            _seller,
            _purchaseAmount,
            _agreementHash,
            msg.sender,
            EscrowRegistry(registry).getFeeRate(msg.sender)
        ));
        allEscrows.push(newEscrow);
        emit EscrowCreated(newEscrow, _buyer, _seller);
        return newEscrow;
    }
}

/// @title Real Estate Escrow Contract
contract RealEstateEscrow {
    address public immutable buyer;
    address public immutable seller;
    address public immutable escrowAgent;
    uint256 public immutable purchaseAmount;
    bytes32 public immutable agreementHash;
    uint256 public immutable feeRate;

    bool public isApproved;
    bool public isFinalized;
    bool public isCancelled;
    uint256 public depositTimestamp;

    bool public buyerSigned;
    bool public sellerSigned;

    event Deposited(address indexed from, uint256 amount);
    event Approved(address indexed by);
    event Finalized(address indexed to);
    event Cancelled(address indexed by, uint256 penalty);
    event AgreementSigned(address indexed signer);

    modifier onlyBuyer() {
        require(msg.sender == buyer, "Only buyer can call this");
        _;
    }

    modifier onlySeller() {
        require(msg.sender == seller, "Only seller can call this");
        _;
    }

    modifier onlyEscrowAgent() {
        require(msg.sender == escrowAgent, "Only escrow agent can call this");
        _;
    }

    modifier notFinalized() {
        require(!isFinalized, "Transaction already finalized");
        _;
    }

    modifier notCancelled() {
        require(!isCancelled, "Transaction cancelled");
        _;
    }

    constructor(
        address _buyer,
        address _seller,
        uint256 _purchaseAmount,
        bytes32 _agreementHash,
        address _escrowAgent,
        uint256 _feeRate
    ) {
        require(_buyer != address(0) && _seller != address(0), "Invalid address");
        require(_purchaseAmount > 0, "Amount must be greater than 0");
        require(_agreementHash != bytes32(0), "Agreement hash required");

        buyer = _buyer;
        seller = _seller;
        escrowAgent = _escrowAgent;
        purchaseAmount = _purchaseAmount;
        agreementHash = _agreementHash;
        feeRate = _feeRate;
    }

    function signAgreement(bytes32 _hash) external notFinalized notCancelled {
        require(_hash == agreementHash, "Agreement hash mismatch");

        if (msg.sender == buyer) {
            buyerSigned = true;
        } else if (msg.sender == seller) {
            sellerSigned = true;
        } else {
            revert("Not authorized to sign");
        }

        emit AgreementSigned(msg.sender);
    }

    function deposit() external payable onlyBuyer notFinalized notCancelled {
        require(msg.value == purchaseAmount, "Incorrect deposit amount");
        depositTimestamp = block.timestamp;
        emit Deposited(msg.sender, msg.value);
    }

    function approve() external onlyBuyer notFinalized notCancelled {
        require(address(this).balance == purchaseAmount, "Escrow not fully funded");
        isApproved = true;
        emit Approved(msg.sender);
    }

    function finalizeSale() external onlyEscrowAgent notFinalized notCancelled {
        require(isApproved, "Approval required");
        require(address(this).balance == purchaseAmount, "Insufficient escrow balance");
        require(buyerSigned && sellerSigned, "Both parties must sign agreement");

        uint256 fee = (purchaseAmount * feeRate) / 10000;
        uint256 sellerAmount = purchaseAmount - fee;

        isFinalized = true;

        (bool feeSent, ) = escrowAgent.call{value: fee}("");
        require(feeSent, "Fee transfer failed");

        (bool success, ) = seller.call{value: sellerAmount}("");
        require(success, "Transfer to seller failed");

        emit Finalized(seller);
    }

    function cancelByBuyer() external onlyBuyer notFinalized notCancelled {
        require(depositTimestamp != 0, "Deposit not made");
        isCancelled = true;

        uint256 penalty = 0;
        if (block.timestamp > depositTimestamp + 1 days) {
            penalty = (purchaseAmount * 1) / 100000; // 0.001% penalty after 24 hours
        }

        uint256 refundAmount = address(this).balance - penalty;

        if (penalty > 0) {
            (bool feePaid, ) = escrowAgent.call{value: penalty}("");
            require(feePaid, "Penalty transfer failed");
        }

        (bool refunded, ) = buyer.call{value: refundAmount}("");
        require(refunded, "Refund to buyer failed");

        emit Cancelled(msg.sender, penalty);
    }

    function cancelTransaction() external onlyEscrowAgent notFinalized notCancelled {
        isCancelled = true;
        if (address(this).balance > 0) {
            (bool refunded, ) = buyer.call{value: address(this).balance}("");
            require(refunded, "Refund to buyer failed");
        }
        emit Cancelled(msg.sender, 0);
    }

    function getEscrowDetails()
        external
        view
        returns (address, address, uint256, bool, bool, bytes32, bool, bool, uint256)
    {
        return (buyer, seller, address(this).balance, isFinalized, isCancelled, agreementHash, buyerSigned, sellerSigned, feeRate);
    }

    receive() external payable {
        revert("Send via deposit() only");
    }
}

